

CREATE TABLE `aksesoris` (
  `id` int(11) NOT NULL,
  `nama` varchar(50) NOT NULL,
  `qty` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `aset_alih_sewa` (
  `no_aset_sewa` varchar(20) NOT NULL,
  `no_aset_pg` varchar(20) NOT NULL,
  `tgl` date NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `aset_jaringan` (
  `id_aset` int(11) NOT NULL,
  `no_aset_jaringan` varchar(50) NOT NULL,
  `nama_aset_jaringan` varchar(100) NOT NULL,
  `subnet` int(11) NOT NULL,
  `ip` varchar(25) NOT NULL,
  `kd_uker` varchar(15) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `aset_model_jaringan` (
  `id_model` int(11) NOT NULL,
  `nama_model` varchar(100) NOT NULL,
  `tahun_model` year(4) NOT NULL,
  `jenis_aset_model` varchar(15) NOT NULL,
  `qty` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `comments` (
  `comment_id` int(11) NOT NULL,
  `comment_subject` varchar(100) NOT NULL,
  `comment_text` varchar(255) NOT NULL,
  `comment_status` int(1) NOT NULL DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;






CREATE TABLE `consumable` (
  `id` int(11) NOT NULL,
  `nama_consumable` varchar(50) NOT NULL,
  `id_kategori` int(11) NOT NULL,
  `id_manufaktur` int(11) NOT NULL,
  `no_model` int(11) NOT NULL,
  `no_item` int(11) NOT NULL,
  `po` int(11) NOT NULL,
  `tgl_po` date NOT NULL,
  `id_sup` varchar(15) NOT NULL,
  `harga` int(11) NOT NULL,
  `qty` int(11) NOT NULL,
  `sisa` int(11) NOT NULL,
  `minqty` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `consumable_user` (
  `id` int(11) NOT NULL,
  `id_user` int(10) DEFAULT NULL,
  `id_consumable` int(15) DEFAULT NULL,
  `qty` int(11) NOT NULL,
  `dibagikanke` int(15) DEFAULT NULL,
  `tgldibagikan` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `custom_field_custom_fieldset` (
  `custom_field_id` int(11) NOT NULL,
  `custom_fieldset_id` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;






CREATE TABLE `custom_fields` (
  `id` int(10) unsigned NOT NULL,
  `name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `format` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `element` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `field_values` text COLLATE utf8mb4_unicode_ci,
  `db_column` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;






CREATE TABLE `custom_fieldsets` (
  `id` int(10) unsigned NOT NULL,
  `name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;






CREATE TABLE `data_aset` (
  `no` int(11) NOT NULL AUTO_INCREMENT,
  `no_aset` varchar(25) NOT NULL,
  `tahun` year(4) NOT NULL,
  `kd_kategori` varchar(10) NOT NULL,
  `model` varchar(50) NOT NULL,
  `sn` varchar(50) NOT NULL,
  `ip_address` varchar(50) DEFAULT NULL,
  `os` varchar(50) DEFAULT NULL,
  `proc` varchar(50) DEFAULT NULL,
  `ramhd` varchar(50) DEFAULT NULL,
  `vga` varchar(50) NOT NULL,
  `kd_uker` varchar(15) DEFAULT NULL,
  `nama_unitkerja` varchar(100) NOT NULL,
  `nik` varchar(15) DEFAULT NULL,
  `nama_karyawan` varchar(100) NOT NULL,
  `lokasi` varchar(15) DEFAULT NULL,
  `id_sup` int(11) NOT NULL,
  `sewa` tinyint(1) NOT NULL,
  `po` varchar(50) NOT NULL,
  `tgl_po` date DEFAULT NULL,
  `harga` int(11) NOT NULL,
  `created_at` date DEFAULT NULL,
  `update_at` date DEFAULT NULL,
  `admin_update` int(11) NOT NULL,
  `audit_at` date DEFAULT NULL,
  `audit_next` date DEFAULT NULL,
  `audit_by` int(11) NOT NULL,
  `id_monitor` varchar(25) DEFAULT NULL,
  `checkout_date` date DEFAULT NULL,
  `checkin_date` date DEFAULT NULL,
  `catatan` text,
  `admin` int(11) NOT NULL,
  `status` varchar(100) NOT NULL,
  PRIMARY KEY (`no`)
) ENGINE=InnoDB AUTO_INCREMENT=7180 DEFAULT CHARSET=latin1;


