CREATE TABLE `data_aset_logs` (
  `id` int(11) NOT NULL,
  `aset_id` int(11) NOT NULL,
  `no_aset` varchar(50) NOT NULL,
  `aksi` varchar(25) NOT NULL,
  `target` varchar(50) NOT NULL,
  `catatan` text NOT NULL,
  `admin` int(11) NOT NULL,
  `tgl` date NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `data_aset_scrab` (
  `idscrab` int(11) NOT NULL,
  `no_aset` varchar(25) NOT NULL,
  `tahun` year(4) NOT NULL,
  `kd_kategori` varchar(10) NOT NULL,
  `model` varchar(50) NOT NULL,
  `sn` varchar(50) NOT NULL,
  `ip_address` varchar(50) DEFAULT NULL,
  `os` varchar(50) DEFAULT NULL,
  `proc` varchar(50) DEFAULT NULL,
  `ramhd` varchar(50) DEFAULT NULL,
  `vga` varchar(50) NOT NULL,
  `lokasi` varchar(15) DEFAULT NULL,
  `id_sup` int(11) NOT NULL,
  `po` varchar(50) NOT NULL,
  `tgl_po` date DEFAULT NULL,
  `harga` int(11) NOT NULL,
  `tgl_scrab` date DEFAULT NULL,
  `catatan` text,
  `admin` int(11) NOT NULL,
  `status` varchar(100) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `data_karyawan` (
  `nik` varchar(15) NOT NULL,
  `nama_karyawan` varchar(100) NOT NULL,
  `kd_uker` varchar(15) NOT NULL,
  `nama_unitkerja` varchar(100) NOT NULL,
  `dep` varchar(100) NOT NULL,
  `email` varchar(50) NOT NULL,
  `tlp` varchar(15) NOT NULL,
  `img` varchar(50) NOT NULL,
  `organik` varchar(15) NOT NULL,
  PRIMARY KEY (`nik`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `data_kategori` (
  `id` int(11) NOT NULL,
  `kd_kategori` varchar(5) NOT NULL,
  `nama_kategori` varchar(15) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `data_model` (
  `model` varchar(50) NOT NULL,
  `kd_kategori` varchar(15) NOT NULL,
  `os` varchar(50) NOT NULL,
  `proc` varchar(25) NOT NULL,
  `hdd` varchar(15) NOT NULL,
  `ram` varchar(15) NOT NULL,
  `deskripsi` text NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `data_pemasok` (
  `id_sup` int(11) NOT NULL,
  `nama_sup` varchar(50) NOT NULL,
  `alamat_sup` varchar(100) NOT NULL,
  `tlp_sup` varchar(15) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `data_uker` (
  `kd_uker` varchar(15) NOT NULL,
  `nama_uker` varchar(50) NOT NULL,
  `formasi_uker` int(11) NOT NULL,
  `formasi_organik` int(11) NOT NULL,
  `formasi_non_organik` int(11) NOT NULL,
  `g1` int(11) NOT NULL,
  `g2` int(11) NOT NULL,
  `g3` int(11) NOT NULL,
  `g4` int(11) NOT NULL,
  `g5` int(11) NOT NULL,
  `g6` int(11) NOT NULL,
  `g7` int(11) NOT NULL,
  `gpk` int(11) NOT NULL,
  `non_organik` int(11) NOT NULL,
  PRIMARY KEY (`kd_uker`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `data_uker_bagian` (
  `kd_uker` varchar(15) NOT NULL,
  `kd_bag` varchar(15) NOT NULL,
  `nama_bag` varchar(50) NOT NULL,
  `formasi` int(11) NOT NULL,
  `formasi_non_organik` int(11) NOT NULL,
  `non_organik_bag` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `kategori` (
  `id_kategori` int(11) NOT NULL,
  `nama_kategori` varchar(50) NOT NULL,
  `tipe` varchar(20) NOT NULL,
  `tgl` date NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `kebutuhan` (
  `id` int(11) NOT NULL,
  `id_uker` varchar(15) NOT NULL,
  `id_kategori` varchar(5) NOT NULL,
  `qty` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `komponen` (
  `id` int(11) NOT NULL,
  `nama_komponen` varchar(100) NOT NULL,
  `id_kategori` int(11) NOT NULL,
  `id_sup` int(11) DEFAULT NULL,
  `po` int(11) DEFAULT NULL,
  `tgl_po` date DEFAULT NULL,
  `harga_po` int(11) NOT NULL,
  `qty` int(11) NOT NULL,
  `sisa` int(11) NOT NULL,
  `min_qty` int(11) NOT NULL,
  `id_user` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `komponen_aset` (
  `id` int(11) NOT NULL,
  `id_komponen` int(11) NOT NULL,
  `id_aset` varchar(25) NOT NULL,
  `serial` varchar(100) NOT NULL,
  `tgldibagikan` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `id_user` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `licensi` (
  `id` int(11) NOT NULL,
  `nama_licensi` varchar(100) NOT NULL,
  `serial` varchar(100) NOT NULL,
  `tgl_po` date NOT NULL,
  `po` int(11) NOT NULL,
  `harga_po` decimal(10,0) NOT NULL,
  `seats` int(11) NOT NULL,
  `sisa` int(11) NOT NULL,
  `licensi_user` varchar(100) NOT NULL,
  `licensi_email` varchar(100) NOT NULL,
  `tgl_kadaluarsa` date NOT NULL,
  `id_kategori` int(11) NOT NULL,
  `id_manufaktur` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `licensi_seat` (
  `id` int(11) NOT NULL,
  `id_licensi` int(11) NOT NULL,
  `id_karyawan` varchar(15) DEFAULT NULL,
  `no_aset` varchar(50) DEFAULT NULL,
  `tgldibagikan` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `id_user` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `manufaktur` (
  `id_manufaktur` int(11) NOT NULL,
  `nama_manufaktur` varchar(50) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `perbaikan` (
  `id` int(11) NOT NULL,
  `no_aset` varchar(50) NOT NULL,
  `pengirim` varchar(50) NOT NULL,
  `tlp` int(11) NOT NULL,
  `keluhan` text NOT NULL,
  `tgl_masuk` date NOT NULL,
  `tindakan` text NOT NULL,
  `tgl_selesai` date DEFAULT NULL,
  `status_perbaikan` varchar(15) NOT NULL,
  `sewa` tinyint(1) NOT NULL,
  `admin` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `status_labels` (
  `id` int(10) unsigned NOT NULL,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `deployable` tinyint(1) NOT NULL DEFAULT '0',
  `notes` text COLLATE utf8mb4_unicode_ci
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;






CREATE TABLE `tb_teknisi` (
  `id` int(11) NOT NULL,
  `id_user` int(10) NOT NULL,
  `sewa` tinyint(1) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `tb_unitkerja` (
  `unitkerja` varchar(50) NOT NULL,
  `nm_unitkerja` varchar(50) DEFAULT NULL,
  `kode_dep` varchar(50) NOT NULL,
  `dep` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`unitkerja`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;






CREATE TABLE `users` (
  `id_user` int(10) unsigned NOT NULL,
  `nikuser` varchar(15) NOT NULL,
  `nama` varchar(200) NOT NULL,
  `email` varchar(100) NOT NULL,
  `username` varchar(200) NOT NULL,
  `password` text NOT NULL,
  `level_user` varchar(150) NOT NULL DEFAULT 'member'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




